import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LandingPage from './components/landingpage';  // Existing component
import HomePage from './components/homepage';      // HomePage with Sidebar
import InvoiceList from './components/invoice_list';  // Placeholder for invoices
import Dashboard from './components/dashboard';      // Placeholder for dashboard
import Reminders from './components/reminders';      // Placeholder for reminders

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Redirect root to homepage */}
        <Route path="/" element={<Navigate to="/landingpage" />} />

        {/* Landing Page */}
        <Route path="/landingpage" element={<LandingPage />} />

        {/* HomePage with Sidebar navigation */}
        <Route path="/homepage/*" element={<HomePage />}>
          {/* Define sub-routes for pages under the HomePage layout */}
          <Route path="dashboard" element={<Dashboard />} />
          <Route path="invoices" element={<InvoiceList />} />
          <Route path="reminders" element={<Reminders />} />
        </Route>

        {/* Other routes can be added here */}
      </Routes>
    </Router>
  );
};

export default App;
